<script>



window.open("#", 849594, "width=243,height=234");

function update() {
	setTimeout(() => {
    	window.resizeTo(300, 315);
        window.wres = document.getElementById("resl").value;
        window.what = document.getElementById("aspr").value.split(':')
        window.as = YTres(wres, what[1], what[0])
        update();
    }, 50)

var winopened = false;
musical = undefined
embedded = undefined
embedyt = undefined
prevurlyt =  "https://www.youtube.com/watch?v=AjWfY7SnMBI"
imagered = undefined
var yy = document.getElementById("text");
var getParams = function (url) {
	var params = {};
	var parser = document.createElement('a');
	parser.href = url;
	var query = parser.search.substring(1);
	var vars = query.split('&');
	for (var i = 0; i < vars.length; i++) {
		var pair = vars[i].split('=');
		params[pair[0]] = decodeURIComponent(pair[1]);
	}
	return params;
};
function popUp(URL) {
    day = new Date();
    id = day.getTime();
    popUpCen(URL, 854, 480)
};


function popUpCen(url, windowWidth, windowHeight) {
    day = new Date();
    id = day.getTime();
    myleft = (screen.width) ? (screen.width - windowWidth) / 2 : 100 / 4;
    mytop = (screen.height) ? (screen.height - windowHeight) / 2 : 100 / 4;
    properties = "width=" + windowWidth + ",height=" + windowHeight + ",toolbar=1,scrollbars=1,location=0,statusbar=0,menubar=1,resizable=1,top=" + mytop + ",left=" + myleft;
    window.open(url, id, properties);
    text.value = '';
};

function popUpKeep(url, id, windowWidth, windowHeight) {
    myleft = (screen.width) ? (screen.width - windowWidth) / 2 : 100;
    mytop = (screen.height) ? (screen.height - windowHeight) / 2 : 100;
    myleft /= 3
    mytop /= 3
    properties = "width=" + windowWidth + ",height=" + windowHeight + ",toolbar=0,scrollbars=1,location=0,statusbar=1,menubar=0,resizable=1,top=" + mytop+ ",left=" + myleft;
    eval(id+"=window.open(url, id, properties)")
    text.value = '';
};
function NGPcrop() {
    if (text.value.includes("newgrounds.com/portal/view/")) {
        var col = text.value.length - 6;
    } else {
        alert("Invalid URL");
        var col = 163
    };
    if (col != 163) {
        let res = text.value.substring(col, text.value.length);
        var col = undefined;
        popUpCen('redirect.html?prot=newgroundspalyer&src='+res, 600, 400)
    }
}

function WEBcrop() {
    if (text.value.includes('http://') || text.value.includes('https://') || text.value.includes('data:') || text.value.includes('about:')) {
        var cok = text.value;
    } else {
        var cok = "http://" + text.value;
    };
    popUp(cok);
}

function YTcrop() {
    if(embedyt != undefined){
    	embedyt.close()
    	window.embedyt = undefined
    };
    if(text.value == "" && embedyt == undefined){
    	text.value = prevurlyt
    };
    var cor = text.value.length
    if (text.value.includes("youtube.com/watch?")) {
        window.invalid = false
    } else if (text.value.includes("youtu.be")){
    	window.invalid = 2
    } else {
        alert("Invalid URL");
        window.invalid = true
    };
    if (invalid == 0) {
        let params = getParams(text.value)
        prevurlyt = text.value
        popUpKeep('https://youtube.com/embed/' + params.v + '?autoplay=1&start='+ params.t +'&modestbranding=1&vq=hd720&loop=1&list=' + params.list, "embedyt", as[0], as[1])
        window.invalid = undefined
    } else if (invalid == 2){
        videoId = text.value.substring(text.value.length - 11, text.value.length)
        prevurlyt = text.value
        popUpKeep('https://youtube.com/embed/' + videoId + '?autoplay=1&modestbranding=1&vq=hd720&loop=1', "embedyt", as[0], as[1])
        window.invalid = undefined
    }
}

function YTres(h, ah, aw) {
	h = Number(h)
	var ret = [h / ah * aw,h]
    return ret;
}

function hyperlinks(target) {
    if (target) where = "_blank";
    else where = "_self";
    for (var i = 0; i <= (document.links.length - 1); i++) {
        document.links[i].target = where;
    }
}

function musicOpener() {
    if (musical == undefined) {
    	window.musical = window.open('audio.html', 'audio', 'width=200,height=200,toolbar=1,scrollbars=1,location=0,statusbar=0,menubar=1,resizable=1,top=100,left=100');

        window.musical = undefined;
        musicOpener()
    }
}
    function previewFile() {
      var file    = document.querySelector('input[type=file]').files[0];
      var reader  = new FileReader();
    
      reader.onloadend = function () {
      text.value = reader.result;
     }
    
     if (file) {
        reader.readAsDataURL(file);
      } else {
        text.value = "";
